// src/components/setupFeed.js
import React, { useState, useEffect } from 'react';
import { getSetupLog } from '../alerts/setupLogger';
import { getSessionTag } from '../alerts/tagGenerator';

const SetupFeed = ({ filterDashboard }) => {
  const [setups, setSetups] = useState([]);

  useEffect(() => {
    const log = getSetupLog();
    const filtered = filterDashboard
      ? log.filter((s) => s.dashboard === filterDashboard)
      : log;
    setSetups(filtered);
  }, [filterDashboard]);

  const copyTags = (tags) => {
    navigator.clipboard.writeText(tags);
    alert('üìã TraderVue tags copied to clipboard!');
  };

  const groupedSetups = setups.reduce((acc, setup) => {
    const key = setup.dashboard || 'Unassigned';
    if (!acc[key]) acc[key] = [];
    acc[key].push(setup);
    return acc;
  }, {});

  return (
    <div style={{ maxHeight: '400px', overflowY: 'scroll', padding: '1rem', border: '1px solid #ccc' }}>
      <h3>üìà ICC Setup Feed</h3>
      {Object.entries(groupedSetups).map(([dashboard, entries]) => (
        <div key={dashboard} style={{ marginBottom: '2rem' }}>
          <h4>üìä {dashboard}</h4>
          {entries.map((setup, index) => (
            <div key={index} style={{ marginBottom: '1rem', padding: '0.5rem', borderBottom: '1px solid #eee' }}>
              <strong>{setup.source}</strong> ‚Äî {setup.iccTags.join(', ')}
              <br />
              <span>üïí {new Date(setup.timestamp).toLocaleString()} ({getSessionTag(setup.timestamp)})</span>
              <br />
              <span>üè∑Ô∏è <code>{setup.tradervueTags}</code></span>
              <br />
              <button onClick={() => copyTags(setup.tradervueTags)} style={{ marginTop: '0.5rem' }}>
                üìã Copy Tags
              </button>
            </div>
          ))}
        </div>
      ))}
    </div>
  );
};

export default SetupFeed;
